import React from 'react';

const CreateRoom = props => {
  const handleSubmit = e => {
    e.preventDefault();
  }
  return (
    <div>
      <form onSubmit={e => handleSubmit(e)}>
        <input placeholder="Create a room" type="text"/>
      </form>
    </div>
  )
}

export default CreateRoom;
